import MembersDefault from "./default/MembersDefault.js";
import MembersEdit from "./edit/MembersEdit.js";
export default {
  props: {
    members: {
      type: Array,
      required: true
    },
    membersCount: {
      type: Number,
      required: true
    },
    membersPage: {
      type: Number,
      required: true
    },
    membersPagesCount: {
      type: Number,
      required: true
    },
    route: {
      type: String,
      required: true
    },
    editableMember: {
      type: Object,
      required: true
    },
    shortRanks: {
      type: Array,
      required: true
    }
  },
  render(h) {
    console.log(`h_-_-`);
    console.log(h);
    if (typeof h === "function") {
      if (this.route === "members/edit") {
        return h(MembersEdit, {
          key: "members/edit",
          props: {
            editableMember: this.editableMember,
            shortRanks: this.shortRanks
          }
        });
      } else {
        return h(MembersDefault, {
          key: "members",
          props: {
            members: this.members,
            membersCount: this.membersCount,
            membersPage: this.membersPage,
            membersPagesCount: this.membersPagesCount
          }
        });
      }
    }
  }
};

